button.theme-switcher {
  transition: all 0.3s ease-in-out;
  padding: 0.5rem;
  border-radius: 9999px; 
}

button.theme-switcher:hover {
  background-color: transparent;
}

.theme-switcher-theme{
  border: 2px solid var(--color-primary-500);
  background-color: var(--color-primary-500);
  color:var(--color-primary-100);
}

.theme-switcher-theme:hover{
  color:var(--color-primary-500);
}


.dark .theme-switcher-theme{
  border: 2px solid var(--color-primary-600);
  background-color: var(--color-primary-600);
  color:var(--color-primary-50);
}

.dark .theme-switcher-theme:hover{
  border: 2px solid var(--color-primary-600);
  color:var(--color-primary-50);
}


button.language-button {
  display: inline-flex;
  justify-content: center;
  padding: 0.625rem; 
  border-radius: 9999px;
  cursor: pointer;
  border: 2px solid;
  transition: background-color 0.2s ease;
}

button.language-button:hover {
  background-color: transparent;
}

.language-button-theme {
  background-color: var(--color-primary-500);
  border-color: var(--color-primary-500);
}

.dark .language-button-theme {
  background-color: var(--color-primary-600);
  border-color: var(--color-primary-600);
}

.dark .language-button-theme:hover {
  border-color: var(--color-primary-600);
}

.language-menu-theme {
  background-color: var(--color-primary-500);
}

.dark .language-menu-theme {
  background-color: var(--color-primary-600);
}

.language-menu-link-theme:hover {
  background-color: var(--color-primary-600);
  color: var(--color-primary-50);
}

.dark .language-menu-link-theme:hover {
  background-color: var(--color-primary-400);
  color: var(--color-primary-50);
}

